import React from 'react';

const AboutUpdate = (props) => {

		const dataLocal = props.dataLocal.filter(data => data.category === 'About').pop()

		const display = (                                       
				<div>
						<div className='infoCategory'>
						{dataLocal.category}
						</div>                                          
				<form>
						<div className='infoTitle'>                                              
						<label>Title :</label>
						<input type='text' className='nameForm' value={dataLocal.title}/>
						</div>
				</form>
				<form>
						<div className='aboutContent'>
						<label>Content :</label>
						<input type='textarea' className='messageForm' rows='5' value={dataLocal.content.replace(/_n/g,"\n").toString()}/>
						</div>                                                                   
				</form>
				</div>                                                                                 )                

		return (
		<div>
				{display}
		</div>
		)
}
export default AboutUpdate;
